import lgc from '../lgc.png';
import './Navbar.css'
function Navbar() {
  return (
    <div className="Navbar">
        <img src={lgc} className="logoNavbar" />
        <input type="text" placeholder="Que cherchez-vous?" className="input"></input>
    </div>
  );
}

export default Navbar;
